import React, {FC, Fragment} from "react";
import {Grid} from "@material-ui/core";
import {AncmntLotParameter} from './AncmntLotParameter';
import {useStyles} from './useStyles';
import {dataPrepare} from "@src/components/announcement/create_ancmnt_lot/ancmnt_lot_form/ancmnt_lot_params/helpers";


export const AncmntLotParamsContainer: FC<any> = (props) => {
    const {
        isPreview,
        createAncmnt,
        values,
    } = props;

    const {adParams} = values;

    const data = isPreview ? adParams : dataPrepare(createAncmnt.subCategory.data, adParams);

    const classes = useStyles({isPreview});
    return (
        <Grid
            container
            spacing={2}
            className={classes.root}
        >
            {Object.keys(data).map(key => (
                <Fragment key={key}>
                    <AncmntLotParameter {...props} keyName={key} data={data[key]}/>
                </Fragment>
            ))}
        </Grid>
    )
}
